  

// TypeScript Version: 4.1

/**
* Evaluates the identity function for single-precision floating-point number `x`.
*
* @param x - input value
* @returns input value
*
* @example
* var v = identityf( -1.0 );
* // returns -1.0
*
* @example
* var v = identityf( 2.0 );
* // returns 2.0
*
* @example
* var v = identityf( 0.0 );
* // returns 0.0
*
* @example
* var v = identityf( -0.0 );
* // returns -0.0
*
* @example
* var v = identityf( NaN );
* // returns NaN
*/
declare function identityf( x: number ): number;


// EXPORTS //

export = identityf;
